import React from "react";
import Ccomponent from "./Ccomponent";
import { Menu } from "./Menu";
import "./App.css";

const App = () => {
  return (
    <div>
      <Header />
      <Technologies />
    </div>
  );
};

const Technologies = () => {
  return (
    <div>
      <ul>
        <li>2</li>
      </ul>
      <Ccomponent />
      <Menu />
    </div>
  );
};

const Header = () => {
  return (
    <div>
      <a href="#">Home</a>
      <a href="#">New Feed</a>
      <a href="#">Messages</a>
    </div>
  );
};

export default App;
